Question.TranslatedText:
                    Is there any new AE?
<script src="//ajax.googleapis.com/ajax/libs/jquery/1.9.1/jquery.min.js"></script>
<script lang="Javascript">
   $.noConflict();
   jQuery(document).ready(function($){

    setTimeout(check,50);

    $("div[id=AEDNYN]>input").click(function () {
        setTimeout(check,50);
    });

    function check() {
       if ($("div[id=AEDNYN]>input:checked").val() == "Yes") {
                unhide();
            }
            else {
    hide();
    }
    }


    function hide() {
        $("tr[repeat-template=IG_BCD_0_AEN]").parent().parent().css('display', 'none');
        $("table[class=aka_form_table]>tbody>tr>td>select option:first").attr("selected", "selected");
        $("table[class=aka_form_table]>tbody>tr>td>input").val("");
        $("table[class=aka_form_table]>tbody>tr>td>input").removeAttr("checked");
    }
    function unhide() {
        $("tr[repeat-template=IG_BCD_0_AEN]").parent().parent().css('display', '');
    }
});
</script>

