BASMI, result:

$.noConflict();
jQuery(document).ready(function($)
{
 var tres = $("#TargusResult").parent().parent().find("input");
 var lres = $("#LumbRes").parent().parent().find("input");
  var LatRes = $("#LatRes").parent().parent().find("input");
  var cres = $("#CervResult").parent().parent().find("input");
  var dres = $("#DistRes").parent().parent().find("input");
  var bres = $("#BASMIRes").parent().parent().find("input");
  bres.attr("readonly", true);

function calcRes()
{
   var averg = (parseFloat(tres.val())+parseFloat(lres.val())+parseFloat(LatRes.val())+parseFloat(cres.val())+parseFloat(dres.val()))/5;
   bres.val(parseFloat(averg).toFixed(1));
    bres.change();
    };


$("#calculate6").click(function(){ calcRes(); });
})

