5. Chest excursion, result:

$.noConflict();
jQuery(document).ready(function($)
{
    var ftinsp = $("#FTi").parent().parent().find("input");
    var ftexp = $("#FTe").parent().parent().find("input");
    var stinsp = $("#STi").parent().parent().find("input");
    var stexp = $("#STe").parent().parent().find("input");
    var cres = $("#ChestRes").parent().parent().find("input");
    cres.attr("readonly", true);

    function calcRes()
    {
     var fi = parseFloat(ftinsp.val());
     var fe = parseFloat(ftexp.val());
     var si = parseFloat(stinsp.val());
     var se = parseFloat(stexp.val());
      var sum = ((fi - fe) + (si - se))/2;

      cres.val(sum.toFixed(1));
        cres.change(); 
    };

 $("#calculate14").click(function(){ calcRes(); });

})

