{
 var tr = $("#TargusRight").parent().parent().find("input");
 var tl = $("#TargusLeft").parent().parent().find("input");
 var res = $("#TargusResult").parent().parent().find("input");
  res.attr("readonly", true);

function calcRes()
{
 var averg = (parseFloat(tr.val())+parseFloat(tl.val()))/2;
 if (averg  10 && averg = 13 && averg = 16 && averg = 19 && averg = 22 && averg = 25 && averg = 28 && averg = 31 && averg = 34 && averg = 37){
            res.val(10);
            res.change();
            }

};


$("#calculate1").click(function(){ calcRes(); });
})

